import React from 'react'
import {BrowserRouter as Router,Link, Switch} from 'react-router-dom';
import Route from 'react-router-dom/Route.js';
import Login from '../Login/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
// import {Card} from "react-bootstrap";
import "./main.css";




// function clickMe(){
// alert('you clicked me ');
// }



class  Main extends React.Component {
    

    render() {
      return (
      <Router>
        <div className='main'>  
            <div className='main-container'> 
              <div className='main-body'>
                <h1 className='main-title'>
                </h1>
                  <div className='main-divtext'>
                    <p className='main-text'>
                    Discover <br/>our language activities
          <br/>to practice your new language.
                    </p>
                  </div>
                  {/* <p>Here at Speacty anyone can team up and make activites to learn a language together.</p> */}
                  <div className="main-divbutton">
                   <Link to='/Login'>Join Speacty</Link>
                  </div>
              </div>
            </div>
        </div>
          <Switch>
              <Route exact strict path='/Login'>
                <Login/>
              </Route>
          </Switch>
      </Router>
    );
  }
  }
  
  export default Main;
